Big Sean.text:
Tell Flex to drop a bomb on this shit. So many bombs, ring the alarm, like Vietnam on this shit. So many bombs, make Farrakhan think that Saddam in this bitch. One at a time, I line them up. And bomb on they mom while she watchin' the kids. I'm in a destruction mode if the gold exists. I'm important like the Pope, I'm a Muslim on pork. I'm Makaveli's offspring, I'm the King of New York. King of the Coast; one hand, I juggle 'em both. The juggernaut's all in your jugular, you take me for jokes. Live in the basement, church pews, and funeral faces. Cartier bracelets for my women friends, I'm in Vegas. Who the fuck y'all thought it's supposed to be? If Phil Jackson came back, still no coachin' me. I'm uncoachable, I'm unsociable, fuck y'all clubs! Fuck y'all pictures! Your Instagram can gobble these nuts! Gobble dick up 'til you hiccup, my big homie Kurupt. This the same flow that put the rap game on a crutch. (West, West, West, West, West, West). I've seen niggas transform like villain Decepticons. Mollies probably turn these niggas to fuckin' Lindsay Lohan. A bunch of rich-ass white girls lookin' for parties. Playin' with Barbies. Wreck the Porsche before you give them the car key. Judgement to the monarchy, blessings to Paul McCartney. You called me a black Beatle, I'm either that or a Marley. I don't smoke crack, motherfucker, I sell it! I'm dressed in all black, this is not for the fan of Elvis. I'm aimin' straight for your pelvis. You can't stomach me? You plan on stumpin' me? Bitch, I’ve been jumped before you put a gun on me. Bitch, I put one on yours, I'm Sean Connery. James Bonding with none of you niggas. Climbin' 100 mil in front of me. And I'm gonna get it even if you're in the way. And if you're in it, better run for Pete's sake. I heard the barbershops be in great debates all the time. 'Bout who's the best MC: Kendrick, Jigga, and Nas. Eminem, André 3000;
the rest of y'all. New niggas just new niggas, don't get involved. And I ain't rockin' no more designer shit. White T’s and Nike Cortez,
this red Corvette's anonymous. I'm usually homeboys with the same niggas I'm rhymin' with. But this is hip-hop, and them niggas should know what time it is. And that goes for Jermaine Cole, Big K.R.I.T., Wale. Pusha T, Meek Millz, A$AP Rocky, Drake. Big Sean, Jay Electron', Tyler, Mac Miller. I got love for you all, but I'm tryna murder you niggas. Tryna make sure your core fans never heard of you niggas. They don't wanna hear not one more noun or verb from you niggas. What is competition? I'm tryna raise the bar high. Who tryna jump and get it? You're better off tryna skydive. Out the exit window of five G5's with five grand. With your granddad as the pilot, he drunk as fuck, tryna land. With the hand full of arthritis and poppin' prosthetic leg. Bumpin' Pac in the cockpit so the shit that pops in his head. Is an option of violence, someone heard the stewardess said. That your parachute is a latex condom hooked to a dread. West Coast.
